import React from "react";

import { Container, Ads } from "./styles";
import Button from "../../styles/components/Button";
import api from "../../services/api";

let data = [];

export default function Anuncio({ history }) {
  async function handleSubmit(e) {
    history.push("/ads");
  }

  const loadAds = (async function() {
    const response = await api.get("/ads");
    data = response.data.docs;
    console.log(data);
  })();

  let anuncios = (async function() {
    data.forEach(element => {
      <Ads>
        <p>Título: {element.title}</p>
      </Ads>;
    });
  })();

  return (
    <Container>
      <header>
        <h1>Anúncios</h1>
        <div>
          <Button onClick={handleSubmit}>+ Novo</Button>
        </div>
      </header>
      {data.map(function(object) {
        return <Ads key={object.id} />;
      })}
    </Container>
  );
}
